import React, { Component } from 'react';
import ReactDOM from 'react-dom';
class ListOfProjects extends Component {
    constructor(props) {
        super(props);
        this.press = this.press.bind(this);
    }
    press(){
        /* console.log(this.props.name); */
        /* alert("Hello React!") */
        ReactDOM.render(
            <div>
            <img className="foto" src={this.props.photo} />
            {this.props.name}</div>,
          document.getElementById("im")
          )
       
        }
          
    render() {
        return (
            <div>
                    <div id="im">
                        <img className="foto" src={this.props.photo} onClick={this.press} />
                        {/*  <p>{this.props.name}</p>  */}
                    </div>
            </div>
        );
    }
}

export default ListOfProjects;
